import React, { useState } from 'react';
import { analyzeGenetics } from '../services/geneticService';
import { AlertTriangle } from 'lucide-react';

const GeneticCompatibility = () => {
  const [formData, setFormData] = useState({
    disease: "Huntington's Disease",
    father_sequence: '',
    mother_sequence: '',
    paternal_grandfather_sequence: '',
    paternal_grandmother_sequence: '',
    maternal_grandfather_sequence: '',
    maternal_grandmother_sequence: '',
  });

  const [results, setResults] = useState(null);
  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    try {
      setError(null);
      const response = await analyzeGenetics(formData);
      setResults(response);
    } catch (err) {
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  const diseases = ["Huntington's Disease", "Sickle Cell Anemia", "Muscular Dystrophy"];

  return (
    <div className="bg-white rounded-lg shadow p-6">
      <h1 className="text-2xl font-bold text-gray-800 mb-6">Genetic Compatibility Analysis</h1>
      
      {error && (
        <div className="bg-red-50 border border-red-200 text-red-700 px-4 py-3 rounded relative mb-6 flex items-center">
          <AlertTriangle className="h-5 w-5 mr-2" />
          <span>{error}</span>
        </div>
      )}
      
      <form onSubmit={handleSubmit} className="space-y-6">
        <div className="space-y-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Disease Type
            </label>
            <select 
              name="disease" 
              value={formData.disease}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              {diseases.map(disease => (
                <option key={disease} value={disease}>{disease}</option>
              ))}
            </select>
          </div>

          {/* DNA Sequence Inputs */}
          {['father', 'mother', 'paternal_grandfather', 'paternal_grandmother', 
            'maternal_grandfather', 'maternal_grandmother'].map((person) => (
            <div key={person}>
              <label className="block text-sm font-medium text-gray-700 mb-1">
                {person.split('_').map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(' ')} Sequence
              </label>
              <input
                type="text"
                name={`${person}_sequence`}
                value={formData[`${person}_sequence`]}
                onChange={handleInputChange}
                placeholder="Enter DNA sequence (e.g., ATGCGATCG)"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                required
              />
            </div>
          ))}
        </div>

        <button 
          type="submit"
          disabled={isLoading}
          className="w-full bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition-colors disabled:opacity-50"
        >
          {isLoading ? 'Analyzing...' : 'Analyze Genetic Compatibility'}
        </button>
      </form>

      {results && (
        <div className="mt-8 border-t border-gray-200 pt-6">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Analysis Results</h2>
          
          <div className="bg-blue-50 p-4 rounded-lg mb-6">
            <h3 className="font-medium text-blue-700">Disease: {results.disease}</h3>
            <p className="text-blue-600 mt-1">Results Code: {results.results}</p>
          </div>
          
          <h3 className="text-lg font-medium text-gray-800 mb-3">Punnett Squares:</h3>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {Object.entries(results.punnett_squares).map(([key, square]) => (
              <div key={key} className="bg-gray-50 p-4 rounded-lg">
                <h4 className="text-md font-medium text-gray-700 mb-2 capitalize">
                  {key.split('_').join(' ')}
                </h4>
                <div className="grid grid-cols-2 gap-2">
                  {square.map((genotype, index) => (
                    <div 
                      key={index}
                      className={`p-3 text-center rounded ${
                        genotype.includes('1') ? 'bg-red-100 text-red-700' : 'bg-green-100 text-green-700'
                      }`}
                    >
                      {genotype}
                    </div>
                  ))}
                </div>
                <div className="mt-2 text-sm text-gray-500">
                  {square.filter(g => g.includes('1')).length === 0 ? (
                    <span className="text-green-600">No risk factors detected</span>
                  ) : (
                    <span className="text-red-600">
                      {square.filter(g => g.includes('1')).length} of {square.length} combinations show risk factors
                    </span>
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default GeneticCompatibility;
